Sometimes bad can be so good...

Dan and Rachel are a couple who like to fight. In fact, they love it. It's how they vent, how they communicate, it's even their foreplay. It's how they get off. But, after saying the one word you cannot say to a woman, Dan gets the boot and finds himself kicked out his house and living with Pat and Erin, his brother and sister-in-law, who are only too excited to help set him up with someone new as soon as possible, rather than allow him to return to Rachel, who they hate. Meanwhile, Rachel takes the advice of her best friends, Lydia and Simone, who hate Dan with as much fervor as Pat and Erin hate Rachel. They too decide that anything is better than letting Rachel get back together with Dan, so they go about setting her up on a blind date to get her back in the dating scene as soon as humanly possible. But the heart wants what it wants and in the end, even though Dan and Rachel are terrible to each other, it might just be their awfulness that makes them so right for each other.

Brooklyn Chase, Siri - (bio), Karla Kush, Alektra Blue - (bio), Belle Noire, Evan Stone - (bio) - (interview), Seth Gamble, Alan Stafford

